const Succsess = () =>{

  return (

    <View>
            <Text style={{
              
            }}>
            Fun, payment passed successfully,
            {'\n'}renew!!
            </Text>
            <View>
            <TouchableOpacity 
            onPress={() => navigation.navigate('Home',)}>
                <Text>
